import React from 'react';
import { Navbar, Button, Nav, ButtonGroup } from 'react-bootstrap';
import ButtonToolbar from "react-bootstrap/ButtonToolbar";
import '../../Assets/global-styles/bootstrap-iso.css';
import {Grid, Icon, Menu} from "semantic-ui-react";
class NavbarBootstrap extends React.Component {

    disconnect = () => {
        fetch('http://localhost:3000/logout', {
            method: 'GET',
            credentials: 'include',
            headers: {
                'Content-Type': 'application/json'
            }
        })
            .then(res => {
                if (res.status === 200) {
                    this.setState({connected: false})
                    this.props.history.push('/login');
                } else {
                    const error = new Error(res.error);
                    throw error;
                }
            })
            .catch(err => {
                console.error(err);
                this.setState({warnings: ["Wrong username or password"]});
            });
    };

    render() {
        return (
            <div className='bootstrap-iso'>
                <div className="Menu">
                    <Navbar sticky="top" collapseOnSelect expand="sm">
                        <Navbar.Brand>
                            <img
                                src='./../../img/MatchApp-Logo.png'
                                height="50"
                                alt="MatchApp Logo"/>
                        </Navbar.Brand>
                        <Navbar.Toggle/>
                        <Navbar.Collapse>
                            <Nav className='mr-auto'>
                                <Nav.Link>
                                    <Icon size='large' name='gratipay' />
                                    <span className="itemMenu">Wall</span>
                                </Nav.Link>
                                <Nav.Link>
                                    <Icon size='large' name='user' />
                                    <span className="itemMenu">Profile</span>
                                </Nav.Link>
                                <Nav.Link>
                                    <Icon size='large' name='conversation' />
                                    <span className="itemMenu">Messages</span>
                                </Nav.Link>
                                <Nav.Link>
                                    <Icon size='large' name='bell' />
                                    <span className="itemMenu">Notifications</span>
                                </Nav.Link>
                            </Nav>
                            <Nav>
                                <ButtonToolbar>
                                    <ButtonGroup className='mt-3 mb-3'>
                                        <Button size="md" variant="outline-primary">Log in</Button>
                                        <Button variant="outline-primary">Sign up</Button>
                                    </ButtonGroup>
                                </ButtonToolbar>
                            </Nav>
                        </Navbar.Collapse>
                    </Navbar>
                </div>
            </div>
        )
    }
}

export default NavbarBootstrap;
// id="responsive-navbar-nav"
